import * as React from 'react';
import PropTypes from 'prop-types';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Skeleton from '@mui/material/Skeleton';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import { Button } from "@mui/material";

const data = [
  {
    src: "data:image/jpeg;base64,",
    title: 'Test D`aptitude TA',
    channel: '1 hr',
  },
];

function Media(props) {
  const { loading = false } = props;

  return (
     <Grid container spacing={2}>
      {(loading ? Array.from(new Array(3)) : data).map((item, index) => (
		  <Grid item xs={12} sm={6} md={4} key={index}>
         <Card sx={{ maxWidth: 400, m: 2, border: '2px solid black' }}>
          {item ? (
            <img
              style={{ width: '100%', height: 300 }}
              alt={item.title}
              src={item.src}
            />
          ) : (
            <Skeleton variant="rectangular" width={210} height={118} />
          )}
          <CardContent>
          {item ? (
            <Box sx={{ marginTop: '2rem', pr: 2 }}>
              <Typography sx={{ color: "#000", fontWeight: 200 }} gutterBottom variant="h6">
                {item.title}
              </Typography>
              <Typography display="block" variant="caption" color="text.secondary">
                {item.channel}
              </Typography>
              <Button sx={{ marginTop: '2rem'}} variant="outlined" color="primary">
									Voir l'ensemble des seances
			 </Button>
            </Box>
          ) : (
            <Box sx={{ pt: 0.5 }}>
              <Skeleton />
              <Skeleton width="60%" />
            </Box>
          )}
           </CardContent>
          </Card>
           </Grid>
      ))}
    </Grid>
  );
}

Media.propTypes = {
  loading: PropTypes.bool,
};

export default function RencontrePrelime() {
  return (
    <Box sx={{ overflow: 'hidden' }}>
      <Media />
    </Box>
  );
}
